begin
wwv_flow_api.create_page(
 p_id=>2
,p_user_interface_id=>wwv_flow_api.id(13861197893695319927)
,p_name=>'Relay Workflow : Workflow Processes'
,p_alias=>'PROCESSES'
,p_page_mode=>'MODAL'
,p_step_title=>'Workflow Processes'
,p_reload_on_submit=>'A'
,p_warn_on_unsaved_changes=>'N'
,p_autocomplete_on_off=>'ON'
,p_step_template=>wwv_flow_api.id(13861159575319319906)
,p_page_template_options=>'#DEFAULT#'
,p_help_text=>'No help is available for this page.'
,p_last_updated_by=>'ADMIN'
,p_last_upd_yyyymmddhh24miss=>'20190530155214'
);
wwv_flow_api.create_page_plug(
 p_id=>wwv_flow_api.id(13861201443264328176)
,p_plug_name=>'Workflow Processes'
,p_region_template_options=>'#DEFAULT#'
,p_component_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_api.id(13861171218356319911)
,p_plug_display_sequence=>20
,p_plug_display_point=>'BODY'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select ',
'       ident',
'      ,proc_name',
'      ,proc_desc',
'      ,null link',
'      ,case ',
'        when node_type = ''WAIT'' and sysdate < to_date(timelimit,''YYYY.MM.DD.SSSSS'') then ''fa-ban''',
'        when node_type = ''WAIT'' and sysdate > to_date(timelimit,''YYYY.MM.DD.SSSSS'') then ''fa-step-forward''',
'        when node_type = ''DECISION'' then ''fa-step-forward''',
'        when node_type = ''TASK'' then ''fa-list''',
'        else ''fa-play''',
'       end fa_icon',
'      ,case ',
'        when node_type = ''WAIT'' and sysdate < to_date(timelimit,''YYYY.MM.DD.SSSSS'') then ''danger''',
'        when node_type = ''WAIT'' and sysdate > to_date(timelimit,''YYYY.MM.DD.SSSSS'') then ''warning''',
'        when node_type = ''DECISION'' then ''warning''',
'        when node_type = ''TASK'' then ''warning''',
'        else ''success''',
'       end btn_type',
'      ,node_type',
'      ,hist',
'      ,assign',
'      ,options',
'      ,request_id',
'      ,queue_id',
'from (',
'-- processes that have an active Instance',
'select ',
'    ''01-QUEUE'' ident',
'    ,p.c002 proc_name',
'    ,p.c003 proc_desc',
'    ,q.c006 node_type',
'    ,p.c007 enabled',
'    ,p.c008 active',
'    ,p.c009 allow_more_inst',
'    ,''0'' as open_queue',
'    ,q.c010 hist',
'    ,q.c011 assign',
'    ,q.c012 options',
'    ,q.c002 request_id',
'    ,(select id_record from tk_test_queue where id_request = q.c002) queue_id',
'    ,q.c008 timelimit',
'    ,q.c009 conditional',
'from apex_collections p -- process',
'    ,apex_collections q -- queue',
'where 1=1',
'  and q.c005 = p.c006 -- join by object',
'  and q.c004 = p.c002 -- join by proc_name',
'  and q.c006 != ''CLOSED'' -- only open',
'  and p.c007 = 1 -- enabled',
'  and q.collection_name = ''RLY.QUEUE.LIST''',
'  and p.collection_name = ''RLY.PROCESS.LIST''',
'  and q.c003 = :RLY_IFACE_KEY',
'    union all',
'-- processes that do not have an active Instance',
'select ',
'    ''02-AVAIL'' ident',
'    ,p.c002 proc_name',
'    ,p.c003 proc_desc',
'    ,''START'' node_type',
'    ,p.c007 enabled',
'    ,p.c008 active',
'    ,p.c009 allow_more_inst',
'    ,p.c010 as open_queue',
'    ,null hist',
'    ,null assign',
'    ,null options',
'    ,null request_id',
'    ,null queue_id',
'    ,null timelimit',
'    ,null ind_conditional',
'from apex_collections p -- process',
'where 1=1',
'  and p.c007 = 1 -- enabled',
'  and p.c008 = 1 -- active',
'  and p.c010 = 0 -- no active instances',
'  and case when p.c009 = 0 ',
'              and (select count(*) ',
'                   from apex_collections ',
'                   where collection_name = ''RLY.QUEUE.LIST''',
'                     and c003 = :RLY_IFACE_KEY',
'                     and c004 = p.c002) = 0 then 0 else 1 end = 1',
'  and p.collection_name = ''RLY.PROCESS.LIST''',
'',
') pq',
'order by 1, 2'))
,p_plug_source_type=>'NATIVE_IR'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_prn_content_disposition=>'ATTACHMENT'
,p_prn_document_header=>'APEX'
,p_prn_units=>'INCHES'
,p_prn_paper_size=>'LETTER'
,p_prn_width=>8.5
