wwv_flow_api.create_page_process(
 p_id=>wwv_flow_api.id(13822423961334799501)
,p_process_sequence=>1
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Run Workflow'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- if a choice for a decision is made then update',
'if :P4_AVAIL_CHOICES is not null then',
'',
'  :P4_ID_LINK := :P4_AVAIL_CHOICES;',
'',
'end if; ',
'',
'if :P4_ID_LINK is not null',
'  or :P4_ASSIGNMENT is not null',
'then',
'    update tk_test_queue',
'    set input_c = :P4_ID_LINK',
'       ,input_a = :P4_ID_ASSIGN',
'    where id_record = :P4_QUEUE_ID;',
'end if;',
'',
'-- run workflow',
'declare',
'  l_id_queue number;',
'begin',
'  if l_id_queue is null and :P4_QUEUE_ID is null then',
'    l_id_queue := pkg_relay_queue.f_load_queue(p_internal_id => :RLY_IFACE_KEY',
'                                              ,p_flow_name => :P4_PROCESS_NAME',
'                                              ,p_obj_name => :RLY_IFACE_OBJ);',
'  else ',
'    l_id_queue := :P4_QUEUE_ID;',
'  end if;',
'  ',
'  -- process the queue',
'  pkg_relay_queue.p_run_queue(p_queue_id => l_id_queue',
'                             ,p_auth_id => pkg_relay_api.g_auth_code);',
'                             ',
'  -- run the workflow interface',
'  pkg_relay_api.p_interface;',
'  ',
'  -- update the queue',
'  pkg_relay_queue.p_update_queue(p_queue_id => l_id_queue);',
'  ',
'  -- update the owner record',
'  pkg_relay_queue.p_update_owner(p_queue_id => l_id_queue);',
'  ',
'  -- check if there are assignments for the user',
'  if pkg_relay_api.g_assignments > 0 then ',
'    ',
'    pkg_relay_iface_apx.p_queue_assign(p_request_id => pkg_relay_api.g_a ',
'                                      ,p_person_code => :APP_USER);',
'    ',
'    apex_util.set_session_state(''P4_IND_ASSIGN'' ',
'                               ,apex_collection.COLLECTION_MEMBER_COUNT(''RLY.QUEUE.ASSIGNMENT''));',
'    ',
'  end if;',
'  ',
'  :P4_ACTNODE_TYPE := pkg_relay_api.g_h;  ',
'  :P4_QUEUE_ID := l_id_queue;',
'  :P4_ID_INSTANCE := pkg_relay_api.g_a;',
'  ',
'/*  ',
'  -- determine routing',
'  case ',
'    when :P4_ACTNODE_TYPE = ''CLOSED'' then ',
'      :P0_IND_RUN_CODE := 0;',
'    when :P4_ACTNODE_TYPE = ''TASK'' and nvl(:P4_IND_ASSIGN,0) > 0 then ',
'      :P0_IND_RUN_CODE := 3;',
'    when :P4_ACTNODE_TYPE = ''DECISION'' and nvl(:P4_IND_ASSIGN,0) > 0 then ',
'      :P0_IND_RUN_CODE := 2;',
'      :P4_QUEUE_ID := l_id_queue;',
'      :P4_ID_INSTANCE := pkg_relay_api.g_a;',
'    when :P4_ACTNODE_TYPE = ''WAIT'' then ',
'      :P0_IND_RUN_CODE := 1;',
'    else ',
'      :P0_IND_RUN_CODE := 0;',
'  end case;',
'*/',
'end;'))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
);
end;
